    "- <font color=red>cv2.HoughLinesP(image, rho, theta, threshold, minLineLength, maxLineGap)</font>\n",
    "    - 허프변환은 모든 점에 대해서 계산을 하기 때문에 시간이 많이 소요 \n",
    "    - 확률 허프 변환 : 모든 픽셀 값을 처리하지 않고 적당히 필요한 만큼 확률적으로 픽셀들을 선택해 연산\n",
